.\n","\n","**generosity:** Cömertlik düzeyini gösteren bir endeks.\n","\n","**income_class:** Ülkelerin gelir sınıflandırmasını gösterir (örn. düşük gelir, orta gelir vs.).\n","\n","**cpi:** Yolsuzluk Algı Endeksi."]},{"cell_type":"code","execution_count":2,"id":"7f2cbe65","metadata":{"execution":{"iopub.execute_input":"2023-11-10T18:54:33.586709Z","iopub.status.busy":"2023-11-10T18:54:33.551052Z","iopub.status.idle":"2023-11-10T18:54:33.607115Z","shell.execute_reply":"2023-11-10T18:54:33.604892Z"},"papermill":{"duration":0.06477,"end_time":"2023-11-10T18:54:33.609533","exception":false,"start_time":"2023-11-10T18:54:33.544763","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["212"],"text/latex":["212"],"text/markdown":["212"],"text/plain":["[1] 212"]},"metadata":{},"output_type":"display_data"}],"source":["# Veri setinde eksik verilerin kontrol edilmesi\n","missing_values_train <- sum(is.na(world_data))\n","missing_values_train"]},{"cell_type":"markdown","id":"6dd5130f","metadata":{"papermill":{"duration":0.00451,"end_time":"2023-11-10T18:54:33.618744","exception":false,"start_time":"2023-11-10T18:54:33.614234","status":"completed"},"tags":[]},"source":["# Veri setindeki eksik değerlerin doldurulması"]},{"cell_type":"code","execution_count":3,"id":"46675efa","metadata":{"execution":{"iopub.execute_input":"2023-11-10T18:54:33.63465Z","iopub.status.busy":"2023-11-10T18:54:33.63063Z","iopub.status.idle":"2023-11-10T18:54:33.674966Z","shell.execute_reply":"2023-11-10T18:54:33.67308Z"},"papermill":{"duration":0.055258,"end_time":"2023-11-10T18:54:33.678561","exception":false,"start_time":"2023-11-10T18:54:33.623303","status":"completed"},"tags":[]},"outputs":[],"source":["# Orijinal veri setinin bir kopyasının saklanması\n","original_world_data <- world_data\n","\n","# country sütununu çıkartılması\n","world_data_numeric <- world_data[, !names(world_data) %in% c(\"country\")]\n","\n","# Veri setindeki eksik değerlerin doldurulması\n","for(i in 1:ncol(wo